define("",["lib_cmd/vue-cmd"],function(require,exports,module){var t=require("lib_cmd/vue-cmd");t.component("com-table-list",{props:["datalist"],computed:{newData:function(){return this.datalist.content.content.forEach(function(t){switch(t.status){case"WAITING":t.status="等待";break;case"CONFIRMED":t.status="确认";break;case"NEGOTIATION":t.status="协商";break;case"PASS":t.status="合格";break;case"FAIL":t.status="不合格"}switch(t.period){case 3:t.period="三天内";break;case 7:t.period="七天内";break;case 10:t.period="十天内"}}),this.datalist}},template:'<table class="table  table-hover table-borderless">                      <thead>                      <tr class="v-table-tr">                            <th class="text-center " v-for="item in datalist.title" v-bind:style="{ width: datalist.style[$index] }">{{item}}</th>                      </tr>                      </thead>                      <tbody class="v-tabs-check">                         <tr v-for="item in newData.content.content">                            <td  class="text-center">{{ item.target }}</td>                            <td  class="text-center">{{ item.status }}</td>                            <td  class="text-center">{{ item.interviewDate }}</td>                            <td  class="text-center">{{ item.period }}</td>                            <td  class="text-center">{{ item.agreeDate }}</td>                            <td  class="text-center">{{ item.user }}</td>                            <td  class="text-center">{{ item.notes }}</td>                        </tr>                      </tbody>                  </table>',methods:{sub:function(t){var e=$(t.target).attr("data-id");$("#modal-fromtext").on("show.bs.modal",function(){$(this).find(".remarks").html("按钮的 _id "+e)})}}})});